import React from "react";
import { ChatAltIcon } from "@heroicons/react/solid";

function Services() {
  return (
    <div className="flex items-center mt-24  rounded-lg shadow-2xl max-w-5xl mx-auto">
      <div className="flex-1 mx-auto p-10 items-center">
        {/* Text */}
        <div className="text-center px-2 top-0 mb-10 items-center font-bold text-6xl py-4 ">
          <div>Our Services</div>
        </div>
        {/* Images */}
        <ul className="grid grid-cols-1 gap-8 md:grid-cols-2 lg:grid-cols-4 px-2">
          <li className="text-left items-center p-4 block">
            <ChatAltIcon className="w-12 h-12 flex-shrink-0 mb-2 " />
            <div className="text-center text-indigo-500 md:text-left font-bold text-2xl mb-2">
              24/7 Live Chat Support
            </div>
          </li>
        </ul>
      </div>
    </div>
  );
}

export default Services;
